import React, { Component } from 'react';


class Search extends Component {
  constructor (props){
    super(props);
  }

  pesquisa(){
      alert("pesquisa");
  }

  render() {
    
    return (
        
        console.log(this.props.obj.person_name)
    );
  }
}

export default Search;
